package com.nacai.settlement.api.entity.request;import java.io.Serializable;/** * Description:传递查询参数 * Created by shan on 2018/5/29. */public class TempletParams implements Serializable{    private static final long serialVersionUID = 8034475930288919343L;    /**     * 订单号     */    private String orderNo;    /**     * 订单名称     */    private String orderName;    public String getOrderNo() {        return orderNo;    }    public void setOrderNo(String orderNo) {        this.orderNo = orderNo;    }    public String getOrderName() {        return orderName;    }    public void setOrderName(String orderName) {        this.orderName = orderName;    }    @Override    public String toString() {        return "TempletParams{" +                "orderNo='" + orderNo + '\'' +                ", orderName='" + orderName + '\'' +                '}';    }}